status_message:
La movilización nacional en #Chile es en protesta ante el bloqueo del proceso de negociación y en el marco su estrategia de diálogo respecto al conjunto de materias contenidas en el Pliego de Negociación de los trabajadores y trabajadoras.

La Mesa del Sector Público está formada por dirigentes de los 15 gremios de trabajadores del Estado que marchan pacíficamente en el país para exigir mejoras.

