El Pdte. Rafael Correa y el diplomático Ernesto Samper participan en el III Encuentro Latinoamericano Progresista #ELAP2016 donde exponen diferentes temas políticos de las naciones y además retomaron la importancia de la firma de paz en #Colombia y los compromisos que conllevan la consolidación de la misma en Suramérica.

